/* eslint-disable */

import "./App.css";
import Title from "./component/Title";
import Body from "./component/Body";
import { BrowserRouter, Routes, Route, Redirect } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Title />
      <Routes>
        <Route path="*" element={<Body />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
